            <p id=""description"" style=""font-size: 18px;"">The prevailing model of quantum computation describes the computation in terms of a network of quantum logic gates. Entanglement");
            WriteLiteral(@" is an intrinsically quantum effect that involves nonclassical correlations, usually between spatially separated quantum systems. <br>
